import { CartActionTypes } from "../cart/cart.types";

export const toggleLikedHidden = () => ({
  type: "TOGGLE_LIKED_HIDDEN",
});

export const addLikedItem = (item) => ({
  type: "ADD)_LIKED_ITEM",
  payload: item,
});
